import React, { useState } from "react";
import { Modal, Form, Input, InputNumber } from "antd";

const CustomModal = ({
  visible,
  onCancel,
  onhandleAdd,
  editOneData,
  editSecondData,
  editThirdData,
  editFourthData,
  labelOne,
  labelTwo,
  labelThree,
  labelFour,
  nameOne,
  nameTwo,
  nameThree,
  nameFour
}) => {
  const [newdata, setNewData] = useState({
    nameOne,
    nameTwo,
    nameThree,
    nameFour
  });
  return (
    <Modal centered closable={false} visible={visible} onCancel={onCancel}>
      <Form
        onFinish={onhandleAdd(newdata)}
        hideRequiredMark={true}
        initialValues={{
          name: editOneData,
          price: editSecondData,
          type: editThirdData,
          date: editFourthData
        }}
      >
        <Form.Item
          label={labelOne}
          name={nameOne}
          rules={[
            {
              required: true,
              message: `Please input${labelOne}!`
            }
          ]}
        >
          <Input />
        </Form.Item>
        <Form.Item
          label={labelTwo}
          name={nameTwo}
          rules={[
            {
              required: true,
              message: `Please input ${labelTwo}!`
            }
          ]}
        >
          <InputNumber />
        </Form.Item>
        <Form.Item
          label={labelThree}
          name={nameThree}
          rules={[
            {
              required: true,
              message: `Please input ${labelThree}!`
            }
          ]}
        >
          <Input />
        </Form.Item>
        <Form.Item
          label={labelFour}
          name={nameFour}
          rules={[
            {
              required: true,
              message: `Please input ${labelFour}!`
            }
          ]}
        >
          <Input />
        </Form.Item>
      </Form>
    </Modal>
  );
};

export default CustomModal;
